import './Pointstable.css'
import '../css/teams.css'
import React, { useState, useEffect } from 'react'; 
import { useParams } from 'react-router-dom';
import Photocard from "../Photocard/Photocard";
import PBatStats from "../Player/PBatStats/PBatStats";


function GroupTableItem(props) {
    let t = props.team
    return (
        <div className={`pt_team ${t.color}1`}>
            <div className='pt_team_no'>{t.pos}</div>
            <div className='pt_team_Team'>{t.team}</div>
            <div className='pt_team_P'>{t.played}</div>
            <div className='pt_team_W'>{t.won}</div>
            <div className='pt_team_L'>{t.lost}</div>
            <div className='pt_team_Pts'>{t.points}</div>
            <div className='pt_team_NRR'>{t.nrr}</div>
        </div>
    )
}

function GroupTable(props) {
    return (
        <div className='pt_group'>
            <div className='pt_header'>
                <div className='pt_header_items_1'>Team</div>
                <div className='pt_header_items_2'>P</div>
                <div className='pt_header_items_3'>W</div>
                <div className='pt_header_items_4'>L</div>
                <div className='pt_header_items_5'>Pts</div>
                <div className='pt_header_items_6'>NRR</div>
            </div>
            {props.group.map((team, index) => (
            <GroupTableItem key={index} team={team}/>
            ))}
        </div>
    )
}

function Pointstable(props) {
    let { t_id } = useParams();

    let url = `http://localhost:3001/tournament/${t_id}/points_table`
    const [data, setData] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
        const response = await fetch(url);
        const jsonData = await response.json();
        setData(jsonData);
        };

        fetchData();
    }, []);

    if (!data) {
        return <div>Loading...</div>;
      }

    return (

        <div className={`pt ${data.tour}`}>
            {data.points_table.map((group, index) => (
            <GroupTable key={index} group={group}/>
            ))}
        </div>
    )

}

const Graph = ({ xData, yData, color1, color2 }) => {
    // set max range of x and y axis
    const maxX = Math.max(...xData);
    const maxY = Math.max(...yData);

    // calculate scaling factor
    const scale = 300 / Math.max(maxX, maxY);

    // scale data and offset to center
    const scaledXData = xData.map(x => (x * scale) + 150);
    const scaledYData = yData.map(y => 450 - (y * scale));

    // draw x and y axis lines
    const xAxis = <line x1="0" y1="450" x2="600" y2="450" stroke="black" />;
    const yAxis = <line x1="150" y1="0" x2="150" y2="600" stroke="black" />;

    // plot data points
    const plot1 = scaledXData.map((x, i) => (
        <circle key={i} cx={x} cy={scaledYData[i]} r="4" fill={color1} />
    ));
    const plot2 = scaledXData.map((x, i) => (
        <circle key={i} cx={x} cy={scaledYData[i]} r="4" fill={color2} />
    ));

    // draw lines between data points
    const line1 = (
        <polyline
            points={`${scaledXData[0]},${scaledYData[0]} ${scaledXData[1]},${scaledYData[1]} ${scaledXData[2]},${scaledYData[2]} ${scaledXData[3]},${scaledYData[3]}`}
            stroke={color1}
            fill="none"
        />
    );
    const line2 = (
        <polyline
            points={`${scaledXData[0]},${scaledYData[0]} ${scaledXData[1]},${scaledYData[1]} ${scaledXData[2]},${scaledYData[2]} ${scaledXData[3]},${scaledYData[3]}`}
            stroke={color2}
            fill="none"
        />
    );

    return (
        <svg viewBox="0 0 600 600" xmlns="http://www.w3.org/2000/svg">
            {xAxis}
            {yAxis}
            {plot1}
            {plot2}
            {line1}
            {line2}
        </svg>
    );
};

export default Pointstable;
